  \"2015-06-17T01:58:04.184777\",\n\t\"name\": \"shemya-island-prehistory\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 752 artifacts described in this paper
  are from 5 sites on Shemya Island. Artifactual evidence suggests the island had
  a small resident population and was occupied for around 2000 years. The islands
  sites have been wholly or partially destroyed by military construction. Available
  site locations and descriptions have been included in the paper and comprise the
  most complete cultural resource inventory to date.\",\n\t\"license_title\": \"License
